import React, {Component} from "react";
import DepartmentGrid from "./DepartmentsGrid";
import DepartmentList from "./DepartmentsList";
import { Button } from 'react-bootstrap';

class Departments extends Component{
    
    state = {
        layoutType : 1
    }

    changeLayout = (a) =>{
        this.setState = {
            layoutType : a
        }
    }

    render (){
        return(
            <>
                <h1>Departments
                    <Button variant="primary" className="btn-sm ml-2 mr-2">
                        List View
                    </Button>
                    <Button variant="success" className="btn-sm ml-2 mr-2 text-light">
                        Grid View
                    </Button>
                </h1>
                <DepartmentGrid />
                <DepartmentList />
            </>
        )
    }
}

export default Departments;
